import React, { useState, useContext, createContext } from "react";
import France from "@socialgouv/react-departements";

// Crée le contexte
const EntreprisesContext = createContext();

// Fournisseur du contexte
function EntreprisesProvider({ children }) {
  const [entreprises, setEntreprises] = useState([]);

  const ajouterEntreprise = (entreprise) => {
    setEntreprises((prev) => [...prev, entreprise]);
  };

  return (
    <EntreprisesContext.Provider value={{ entreprises, ajouterEntreprise }}>
      {children}
    </EntreprisesContext.Provider>
  );
}

// Custom Hook pour accéder au contexte
function useEntreprises() {
  return useContext(EntreprisesContext);
}

// Composant principal
function App() {
  const [formData, setFormData] = useState({ nom: "", ville: "", departement: "" });
  const [colorData, setColorData] = useState({});
  const { entreprises, ajouterEntreprise } = useEntreprises();

  // Gestion du formulaire
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  // Détecter le département via une API (exemple : GeoAPI Gouv)
  const detecterDepartement = async (ville) => {
    try {
      const response = await fetch(`https://geo.api.gouv.fr/communes?nom=${ville}&fields=nom,codeDepartement`);
      const data = await response.json();
      if (data.length > 0) {
        return data[0].codeDepartement;
      }
      return "";
    } catch (error) {
      console.error("Erreur lors de la détection du département :", error);
      return "";
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const departement = await detecterDepartement(formData.ville);

    if (departement) {
      const nouvelleEntreprise = {
        nom: formData.nom,
        ville: formData.ville,
        departement,
      };

      ajouterEntreprise(nouvelleEntreprise);

      // Mise à jour des couleurs en fonction du nombre d'entreprises
      setColorData((prev) => {
        const newColorData = { ...prev };
        newColorData[departement] = (newColorData[departement] || 0) + 1;
        return newColorData;
      });

      // Réinitialiser le formulaire
      setFormData({ nom: "", ville: "", departement: "" });
    } else {
      alert("Impossible de détecter le département pour cette ville.");
    }
  };

  return (
    <div className="App">
      <h1>Ma carte interactive</h1>
      <France departements={Object.keys(colorData)}
        getDepartementStyle={(code) => {
          const count = colorData[code] || 0;
          return {
            fill: `rgba(0, 0, 255, ${Math.min(0.1 + 0.2 * count, 1)})`,
          };
        }}
      />

      <form onSubmit={handleSubmit}>
        <div>
          <label>Nom de l'entreprise :</label>
          <input
            type="text"
            name="nom"
            value={formData.nom}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label>Ville :</label>
          <input
            type="text"
            name="ville"
            value={formData.ville}
            onChange={handleChange}
            required
          />
        </div>

        <button type="submit">Ajouter</button>
      </form>

      <h2>Entreprises enregistrées</h2>
      <table>
        <thead>
          <tr>
            <th>Nom</th>
            <th>Ville</th>
            <th>Département</th>
          </tr>
        </thead>
        <tbody>
          {entreprises.map((entreprise, index) => (
            <tr key={index}>
              <td>{entreprise.nom}</td>
              <td>{entreprise.ville}</td>
              <td>{entreprise.departement}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

// Encapsuler l'application avec le fournisseur du contexte
export default function AppWrapper() {
  return (
    <EntreprisesProvider>
      <App />
    </EntreprisesProvider>
  );
}
